/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`%`*/ /*!50003 TRIGGER `calcular_notas_before_update` BEFORE UPDATE ON `notas` FOR EACH ROW BEGIN
    
    IF NEW.nota_guia IS NOT NULL AND NEW.nota_informante IS NOT NULL THEN
        SET NEW.nota_tesis = ROUND((NEW.nota_guia + NEW.nota_informante) / 2, 1);
    ELSE
        SET NEW.nota_tesis = NULL;
    END IF;

    
    IF NEW.nota_tesis IS NOT NULL AND NEW.nota_examen_oral IS NOT NULL THEN
        SET NEW.nota_final = ROUND((NEW.nota_tesis * 0.6) + (NEW.nota_examen_oral * 0.4), 1);
    ELSE
        SET NEW.nota_final = NULL;
    END IF;
END */;;
